import pictures from './pictures.json';
import Mysticals from '../Mysticals/mysticals.js';
import './game.css';



class Game extends Component {
    render(){
        console.log("pictures", pictures)
        return(
            <div>
                            <div className="col-md-3">

              {pictures.map(item => (
                <Mysticals 
                name = {item.image}
                id = {item.id}
                //   click = {}
                key={item.id}/>
                ))}  
                </div>
            </div>

        )
    }
};

export default Game;
